class Solution:
     def titleToNumber(self, s):
         """
         :type s: str
         :rtype: int
         """
         res = 0
         for i in s:
             res = res*26 + ord(i) - ord('A')+1
         return res

class Solution:
     def titleToNumber(self, s):
         """
         :type s: str
         :rtype: int
         """
         return 0 if len(s) == 0 else ord(s[-1]) - ord('A') + 1 + 26 * self.titleToNumber(s[:len(s)-1])

class Solution:
     def titleToNumber(self, s):
         """
         :type s: str
         :rtype: int
         """
         if s == "":
             return 0
         return self.titleToNumber(s[:-1])*26 + ord(s[-1]) - ord('A') + 1
